import React from 'react';

function Playlist({ tracks }) {
  console.log("Tracks in Playlist component:", tracks);
  return (
    <div>
      <h2>Generated Playlist</h2>
      {tracks.length > 0 ? (
        <ul>
          {tracks.map((track) => (
            <li key={track.id}>
              {track.name} by {track.artists.map(artist => artist.name).join(', ')}
            </li>
          ))}
        </ul>
      ) : (
        <p>No tracks found. Try different inputs.</p>
      )}
    </div>
  );
}

export default Playlist;
